import {BrowserRouter as  Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar';
import Booking from "./components/pages/Booking"

function App() {

  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path='/Booking' exact component={Booking} />
      </Switch>
    </Router>
  );
}

export default App;
